import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './Navbar';
import Home from './Home'; // Import your home page component
import Blog from './Blog'; // Import your Blog page component
import Experiences from './Experiences'; // Import your Experiences page component
// import Contact from './Contact'; // Import your Contact page component

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <Switch>
          <Route path="/" exact component={Home} />
          <Route path="/blog" component={Blog} />
          <Route path="/experiences" component={Experiences} />
          <Route path="/contact" component={Contact} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
